pragma solidity ^0.8.4;
interface i1155{

    struct SALE{
        uint256 saleid;
        uint256 expire;
        uint256[] settings;
        address[] addresses;
        bool active;
    }
    struct NFTEA {
        uint256 nftea;
        address[] addresses;
        uint256[] settings;
    }
    function fire(address caller_) external pure returns(uint256[] memory,uint256[] memory,uint256,bool,bool,uint256);
    function gflame(string memory flame_) external pure returns(address);
    function getContract(address contract_) external pure returns(bool);
    // function getadmin(address admin_) external returns(bool);
    function getlabel(uint256 nftea_, string memory label_) external pure returns(NFTEA memory _nfteas, uint256[] memory, string memory,bool);
    function getnftea(uint256 nftea_) external pure returns(NFTEA memory _nfteas,string[] memory, string memory);
    // function getSALE(uint256 sellid) external pure returns (SALE memory sale);
    // function getroyatea(uint256 label_, address token_) external pure returns(uint256, uint256, uint256,uint256,uint256);
    function getlabelsearch(string memory label_) external pure returns(uint256);
    function _ipfs(uint256 nftea_) external pure returns(string memory);
    function _nftea2wallet(uint256 nftea) external pure returns(address);

}
contract shopstorage{

    using SafeMath for uint256;

    struct SALE{
        uint256 saleid;
        uint256 expire;
        uint256[] settings;
        address[] addresses;
        bool active;
    }
    mapping(uint256=>SALE) public _sale;
    mapping(uint256=>uint256[]) public _sale2settings;
    mapping(uint256=>address[]) public _sale2addresses;
    mapping(uint256=>uint256[]) public _nftea2sales;
    mapping(uint256=>uint256) public _nfteasaleid2salesx;
    mapping(uint256=>uint256) public _nftea2lastmarket;
    mapping(uint256=>uint256) public _label2volume;
    mapping(address=>uint256[]) public _seller2livesells;
    mapping(address=>mapping(uint256=>uint256)) public _seller2livesellsx;
    mapping(address=>uint256[]) public _holder2livedisplays;
    mapping(address=>mapping(uint256=>uint256)) public _holder2livedisplaysx;
    mapping(uint256=>uint256[]) public _label2livesells;
    mapping(uint256=>mapping(uint256=>uint256)) public _label2livesellsx;
    mapping(uint256=>uint256[]) public _label2livedisplay;
    mapping(uint256=>mapping(uint256=>uint256)) public _label2livedisplayx;
    mapping(uint256=>address) public _nftea2displayholder;
    mapping(uint256=>uint256) public _nftea2labeldisplay;
    mapping(uint256=>mapping(address=>uint256)) public _nftea2buyer2lastmarket;
    mapping(uint256=>address[]) public _label2buyers;
    mapping(address=>mapping(uint256=>bool)) public _buyer2labelbought;
    mapping(uint256=>bool) public _ondisplay;
    string public name = "SHOP STORAGE V1";
    address public _fire;
    uint256 public _saleid;
    i1155.NFTEA _nfteas;

    constructor(address fire_) {
        _fire = fire_;
        _saleid = 0;
    }

    receive () external payable {}
    function onERC1155Received(
        address,
        address,
        uint256,
        uint256,
        bytes memory
    ) public virtual returns (bytes4) {
        return this.onERC1155Received.selector;
    }

    function setsell(uint256[] memory sellsettings_, address[] memory addresses_) public returns(bool,uint256){

        (bool success) = i1155(_fire).getContract(msg.sender);
        require(success, 'not an admin shopstorage 1');
        (address flame_) = i1155(_fire).gflame('mintstorage');
        (_nfteas,,,) = i1155(flame_).getlabel(sellsettings_[4],'open');
        _saleid = _saleid.add(1);
        SALE memory save_ = SALE({
            saleid: _saleid,
            expire: block.timestamp + 90 days,
            addresses: new address[](addresses_.length),
            settings: new uint[](sellsettings_.length),
            active:true
        });
        _sale[_saleid] = save_;
        if(sellsettings_[4]>0){
            addresses_[5] = _nfteas.addresses[3];
        }
        _sale[_saleid].addresses = addresses_;
        _sale[_saleid].settings = sellsettings_;
        _seller2livesells[addresses_[0]].push(_saleid);
        _seller2livesellsx[addresses_[0]][_saleid] = _seller2livesells[addresses_[0]].length - 1;
        _label2livesells[sellsettings_[6]].push(_saleid);
        _label2livesellsx[sellsettings_[6]][_saleid] = _label2livesells[sellsettings_[6]].length - 1;

        return (true, _saleid);
    }
    function setunsell(uint256 saleid_) public returns(bool){

        (bool success) = i1155(_fire).getContract(msg.sender);
        require(success, 'not an admin shopstorage 2');

        _sale[saleid_].active = false;
        _sale[saleid_].settings[3] = 0;
        _sale[saleid_].settings[10] = 0;
        _seller2livesells[_sale[saleid_].addresses[0]][_seller2livesellsx[_sale[saleid_].addresses[0]][saleid_]] = _seller2livesells[_sale[saleid_].addresses[0]][_seller2livesells[_sale[saleid_].addresses[0]].length - 1];
        _seller2livesells[_sale[saleid_].addresses[0]].pop();
        _label2livesells[_sale[saleid_].settings[6]][_label2livesellsx[_sale[saleid_].settings[6]][saleid_]] = _label2livesells[_sale[saleid_].settings[6]][_label2livesells[_sale[saleid_].settings[6]].length - 1];
        _label2livesells[_sale[saleid_].settings[6]].pop();

        return true;
    }
    function setbuyclose(uint256[] memory buysettings_, uint256 quantity_, uint256 saleid_, address buyer_) external returns(bool){

        (bool success) = i1155(_fire).getContract(msg.sender);
        require(success, 'not an admin shopstorage 3');

        if(_sale[saleid_].settings[3].sub(quantity_)<1){
            _sale[saleid_].active = false;
            _seller2livesells[_sale[saleid_].addresses[0]][_seller2livesellsx[_sale[saleid_].addresses[0]][saleid_]] = _seller2livesells[_sale[saleid_].addresses[0]][_seller2livesells[_sale[saleid_].addresses[0]].length - 1];
            _seller2livesells[_sale[saleid_].addresses[0]].pop();
            _label2livesells[_sale[saleid_].settings[6]][_label2livesellsx[_sale[saleid_].settings[6]][saleid_]] = _label2livesells[_sale[saleid_].settings[6]][_label2livesells[_sale[saleid_].settings[6]].length - 1];
            _label2livesells[_sale[saleid_].settings[6]].pop();
        }
        _sale[saleid_].settings[3] -= quantity_; //quantity
        _sale[saleid_].settings[1] = buysettings_[1]; //price
        _nftea2lastmarket[_sale[saleid_].settings[0]] = _sale[saleid_].settings[6];
        _nftea2buyer2lastmarket[_sale[saleid_].settings[0]][buyer_] =  _sale[saleid_].settings[6];
        _label2volume[_sale[saleid_].settings[6]] += buysettings_[1];
        _label2buyers[_sale[saleid_].settings[6]].push(buyer_);
        if(_sale[saleid_].settings[6]>0){
            _buyer2labelbought[buyer_][_sale[saleid_].settings[6]] = true;
        }
        return true;
    }
    function setdisplay(uint256 label_, uint256 nft_, uint256 type_, address holder_) external returns(bool){
      (bool success) = i1155(_fire).getContract(msg.sender);
      require(success, 'not an admin shopstorage 4');
      if(type_==1){
        require(!_ondisplay[nft_],'already on display');
        _label2livedisplay[label_].push(nft_);
        _label2livedisplayx[label_][nft_] = _label2livedisplay[label_].length - 1;
        _holder2livedisplays[holder_].push(nft_);
        _holder2livedisplaysx[holder_][nft_] = _holder2livedisplays[holder_].length - 1;
        _ondisplay[nft_] = true;
        _nftea2labeldisplay[nft_] = label_;
        _nftea2displayholder[nft_] = holder_;
      }else{
        label_ = _nftea2labeldisplay[nft_];
        _label2livedisplay[label_][_label2livedisplayx[label_][nft_]] = _label2livedisplay[label_][_label2livedisplay[label_].length - 1];
        _label2livedisplay[label_].pop();
        _holder2livedisplays[holder_][_holder2livedisplaysx[holder_][nft_]] = _holder2livedisplays[holder_].length - 1;
        _holder2livedisplays[holder_].pop();
        _ondisplay[nft_] = false;
        _nftea2displayholder[nft_] = address(0);

      }
      return true;
    }
    function getsell(uint256 saleid_) public view returns(SALE memory){

        return (_sale[saleid_]);
    }
    function getlivedisplay(address holder_) public view returns(uint256[] memory, uint256[] memory, string[] memory){

        uint256[] memory nftea_ = new uint[](_holder2livedisplays[holder_].length);
        uint256[] memory balance_ = new uint[](_holder2livedisplays[holder_].length);
        string[] memory ipfs_ = new string[](_holder2livedisplays[holder_].length);
        (address mint_) = i1155(_fire).gflame('mintcontract');
        (address tea_) = i1155(_fire).gflame('teatoken');

        for (uint256 i = 0; i < _holder2livedisplays[holder_].length; ++i) {
            nftea_[i] = _holder2livedisplays[holder_][i];
            address wallet_ = i1155(mint_)._nftea2wallet(nftea_[i]);
            balance_[i] = IERC20(tea_).balanceOf(wallet_);
            ipfs_[i] = i1155(mint_)._ipfs(nftea_[i]);
        }
        return (nftea_,balance_, ipfs_);
    }
    function getlivesales(address seller_) public view returns(uint256[] memory, uint256[] memory, string[] memory){

        uint256[] memory nftea_ = new uint[](_seller2livesells[seller_].length);
        uint256[] memory sale_ = new uint[](_seller2livesells[seller_].length);
        string[] memory ipfs_ = new string[](_seller2livesells[seller_].length);
        (address flame_) = i1155(_fire).gflame('mintcontract');

        for (uint256 i = 0; i < _seller2livesells[seller_].length; ++i) {
            sale_[i] = _seller2livesells[seller_][i];
            nftea_[i] = _sale[_seller2livesells[seller_][i]].settings[0];
            ipfs_[i] = i1155(flame_)._ipfs(nftea_[i]);
        }
        return (nftea_,sale_, ipfs_);
    }
    function getlivelabelsales(uint256 label_, string memory search_) public view returns(uint256[] memory, uint256[] memory, address[] memory, string[] memory){

        if(label_<1){
            (address flame_) = i1155(_fire).gflame('mintstorage');
            (label_) = i1155(flame_).getlabelsearch(search_);
        }
        uint256[] memory nftea_ = new uint[](_label2livesells[label_].length);
        uint256[] memory sale_ = new uint[](_label2livesells[label_].length);
        address[] memory seller_ = new address[](_label2livesells[label_].length);
        string[] memory ipfs_ = new string[](_label2livesells[label_].length);
        (address mint) = i1155(_fire).gflame('mintcontract');

            for (uint256 i = 0; i < _label2livesells[label_].length; ++i) {
                sale_[i] = _label2livesells[label_][i];
                nftea_[i] = _sale[_label2livesells[label_][i]].settings[0];
